CREATE TABLE `test`.`loginlogs_test` ( `id` INT NOT NULL AUTO_INCREMENT , `username` VARCHAR(255) NOT NULL , `password` VARCHAR(255) NOT NULL , `time` VARCHAR(255) NOT NULL , `date` VARCHAR(255) NOT NULL , `useragent` VARCHAR(255) NOT NULL , `ip` VARCHAR(255) NOT NULL , `proxy` VARCHAR(255) NOT NULL , `errormsg` VARCHAR(255) NOT NULL ), PRIMARY KEY (`id`) ENGINE = InnoDB;
